const Header = () => {
    return(
        <div className="header">
            <h1>Shivani Anandan</h1>
            <div className="menu">
               <a href="#">Home</a>
               <a href="#">About</a>
               <a href="#">Contact</a>
               <a href="#">Blog</a>
            </div>
        </div>
    )
}

export default Header;
